import React from "react";
import "../../App.css";
import "./ContactUs.css";

function ContactUs() {
    return (
        <>
            <div className="contact-us">
                <h1 className="contact-us-header">CONTACT US</h1>
                <div className="contact-content">
                    <p>
                        281-541-6706
                        <br />
                        theviewc@gmail.com
                        <br />
                        15824 Grant Rd,
                        <br />
                        Cypress, TX 77429
                    </p>
                </div>
            </div>
        </>
    );
}

export default ContactUs;
